import React, { useState, useRef } from "react";
import "./styles/newTrade.css";

const NewTrade = ({ onTradeSubmit }) => {
  const [formData, setFormData] = useState({
    option_symbol: "",
    option_type: "",
    strike_price: "",
    expiration_date: "",
    entry_price: "",
    exit_price: "",
    contracts: "",
    underlying_stock_price: "",
    implied_volatility: "",
    rationale: "",
    feedback: "",
    outcome: "",
  });

  const symbolInputRef = useRef(null); // Ref for the symbol input field

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Call the onTradeSubmit function with the formData as an argument
    onTradeSubmit(formData);
    // Clear the form after submission
    setFormData({
      option_symbol: "",
      option_type: "",
      strike_price: "",
      expiration_date: "",
      entry_price: "",
      exit_price: "",
      contracts: "",
      underlying_stock_price: "",
      implied_volatility: "",
      rationale: "",
      feedback: "",
      outcome: "",
    });
  };

  const handlePlusIconClick = () => {
    symbolInputRef.current.focus(); // Focus the symbol input field
  };

  return (
    <div className="new-trade">
      <div className="card">
        <p>New Trade</p>
        <i
          className="fa-solid fa-plus"
          id="new-btn"
          onClick={handlePlusIconClick} // Call handlePlusIconClick when plus icon is clicked
        ></i>
      </div>
      <form className="new-trade-form" onSubmit={handleSubmit}>
        <ul>
          <li>
            <label htmlFor="option_symbol">Option Symbol:</label>
            <input
              type="text"
              name="option_symbol"
              ref={symbolInputRef} // Assign the ref to the symbol input field
              value={formData.option_symbol}
              onChange={handleChange}
              required
            />
          </li>
          <li>
            <label htmlFor="option_type">Option Type:</label>
            <input
              type="text"
              name="option_type"
              // placeholder="Option Type"
              value={formData.option_type}
              onChange={handleChange}
              required
            />
          </li>
          <li>
            <label htmlFor="strike_price">Strike Price:</label>

            <input
              type="text"
              name="strike_price"
              // placeholder="Strike Price"
              value={formData.strike_price}
              onChange={handleChange}
              required
            />
          </li>
          <li>
            <label htmlFor="expiration_date">Exp. date:</label>
            <input
              type="date"
              name="expiration_date"
              label="exp"
              // placeholder="Exp. date"
              value={formData.expiration_date}
              onChange={handleChange}
              required
            />
          </li>
          <li>
            <label htmlFor="entry_price">Entry Price:</label>
            <input
              type="text"
              name="entry_price"
              // placeholder="Entry Price"
              value={formData.entry_price}
              onChange={handleChange}
              required
            />
          </li>
          <li>
            <label htmlFor="exit_price">Exit Price:</label>
            <input
              type="text"
              name="exit_price"
              // placeholder="Exit Price"
              value={formData.exit_price}
              onChange={handleChange}
            />
          </li>
          <li>
            <label htmlFor="contracts">Contracts:</label>
            <input
              type="text"
              name="contracts"
              // placeholder="Contracts"
              value={formData.contracts}
              onChange={handleChange}
              required
            />
          </li>
          <li>
            <label htmlFor="close_date">Close Date:</label>
            <input
              type="date"
              name="close_date"
              value={formData.close_date}
              onChange={handleChange}
            />
          </li>
          <li>
            <label htmlFor="stock_price">Stock Price:</label>
            <input
              type="text"
              name="stock_price"
              value={formData.stock_price}
              onChange={handleChange}
              required
            />
          </li>
          <li>
            <label htmlFor="implied_volatility">Implied Volatility:</label>
            <input
              type="text"
              name="implied_volatility"
              // placeholder="Implied Volatility"
              value={formData.implied_volatility}
              onChange={handleChange}
              required
            />
          </li>
          <li>
            <label htmlFor="rationale">Rationale:</label>
            <input
              type="text"
              name="rationale"
              // placeholder="Rationale"
              value={formData.rationale}
              onChange={handleChange}
              required
            />
          </li>
          <li>
            <label htmlFor="feedback">Feedback:</label>
            <input
              type="text"
              name="feedback"
              // placeholder="Feedback"
              value={formData.feedback}
              onChange={handleChange}
              required
            />
          </li>
          <li>
            <label htmlFor="outcome">Outcome:</label>
            <input
              type="text"
              name="outcome"
              // placeholder="Outcome"
              value={formData.outcome}
              onChange={handleChange}
              required
            />
          </li>
        </ul>
        <input type="submit" value="Submit" />
      </form>
    </div>
  );
};

export default NewTrade;
